INSERT INTO `block_content` (`id`, `block_id`, `lang`, `content`) VALUES
(37, 20, 'cs', '<p>&nbsp;</p>\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><em><span style="font-size: 12pt; font-family: Verdana, sans-serif;">V&aacute;žen&iacute; z&aacute;kazn&iacute;ci,</span></em><span style="font-size: 12pt; font-family: Verdana, sans-serif;"><br /> v&iacute;t&aacute;me V&aacute;s na internetov&yacute;ch str&aacute;nk&aacute;ch na&scaron;&iacute; firmy, kter&aacute; nab&iacute;z&iacute; kompletn&iacute; servis v oblasti stavebnictv&iacute; a souvisej&iacute;c&iacute;ch služeb.</span></p>\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: normal;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">V na&scaron;em portfoliu najdete &scaron;irokou nab&iacute;dku stavebn&iacute;ch prac&iacute; a rekonstrukc&iacute; rodinn&yacute;ch domů, bytů a interi&eacute;rů na kl&iacute;č. Poskytujeme tak&eacute; poradenstv&iacute; v oblasti realit. Na&scaron;e stavebn&iacute; firma pro V&aacute;s zajist&iacute; kompletn&iacute; realizaci stavby od prvn&iacute;ch n&aacute;vrhů a potřebn&yacute;ch &uacute;ředn&iacute;ch formalit, přes hrubou stavbu až po dokončovac&iacute; pr&aacute;ce.</span></p>\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><strong><span style="font-size: 12pt; font-family: Verdana, sans-serif;">Nab&iacute;z&iacute;me:</span></strong></p>\n<ul type="disc">\n<li class="MsoNormal" style="line-height: normal;"><span style="font-size: 12.0pt; font-family: ''Verdana'',sans-serif; mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-family: ''Times New Roman''; mso-fareast-language: CS;">Stavebn&iacute; činnost</span></li>\n<li class="MsoNormal" style="line-height: normal;"><span style="font-size: 12.0pt; font-family: ''Verdana'',sans-serif; mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-family: ''Times New Roman''; mso-fareast-language: CS;">V&yacute;stavba rodinn&yacute;ch domů</span></li>\n<li class="MsoNormal" style="line-height: normal;"><span style="font-size: 12.0pt; font-family: ''Verdana'',sans-serif; mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-family: ''Times New Roman''; mso-fareast-language: CS;">Rekonstrukce bytů</span></li>\n<li class="MsoNormal" style="line-height: normal;"><span style="font-size: 12.0pt; font-family: ''Verdana'',sans-serif; mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-family: ''Times New Roman''; mso-fareast-language: CS;">Ploty</span></li>\n<li class="MsoNormal" style="line-height: normal;"><span style="font-size: 12.0pt; font-family: ''Verdana'',sans-serif; mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-family: ''Times New Roman''; mso-fareast-language: CS;">Gar&aacute;že</span></li>\n<li class="MsoNormal" style="line-height: normal;"><span style="font-size: 12.0pt; font-family: ''Verdana'',sans-serif; mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-family: ''Times New Roman''; mso-fareast-language: CS;">Krby</span></li>\n<li class="MsoNormal" style="line-height: normal;"><span style="font-size: 12.0pt; font-family: ''Verdana'',sans-serif; mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-family: ''Times New Roman''; mso-fareast-language: CS;">Zahrady</span></li>\n<li class="MsoNormal" style="line-height: normal;"><span style="font-size: 12.0pt; font-family: ''Verdana'',sans-serif; mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-family: ''Times New Roman''; mso-fareast-language: CS;">Jez&iacute;rka</span></li>\n<li class="MsoNormal" style="line-height: normal;"><span style="font-size: 12.0pt; font-family: ''Verdana'',sans-serif; mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-family: ''Times New Roman''; mso-fareast-language: CS;">Pergoly</span></li>\n<li class="MsoNormal" style="line-height: normal;"><span style="font-size: 12.0pt; font-family: ''Verdana'',sans-serif; mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-family: ''Times New Roman''; mso-fareast-language: CS;">Zahradn&iacute; krby</span></li>\n<li class="MsoNormal" style="line-height: normal;"><span style="font-size: 12.0pt; font-family: ''Verdana'',sans-serif; mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-family: ''Times New Roman''; mso-fareast-language: CS;">Zahradn&iacute; architektura</span></li>\n<li class="MsoNormal" style="line-height: normal;"><span style="font-size: 12.0pt; font-family: ''Verdana'',sans-serif; mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-family: ''Times New Roman''; mso-fareast-language: CS;">Kamenn&eacute; pr&aacute;ce</span></li>\n<li class="MsoNormal" style="line-height: normal;"><span style="font-size: 12.0pt; font-family: ''Verdana'',sans-serif; mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-family: ''Times New Roman''; mso-fareast-language: CS;">B&aacute;zeny a v&yacute;hřivn&eacute; vany</span></li>\n</ul>'),
(38, 20, 'en', '<p style="font-family: ''Times New Roman''; font-size: medium;">V&aacute;žen&iacute; z&aacute;kazn&iacute;ci,<br />v&iacute;t&aacute;me V&aacute;s na internetov&yacute;ch str&aacute;nk&aacute;ch na&scaron;&iacute; firmy.</p>\n<p style="font-family: ''Times New Roman''; font-size: medium;">v&iacute;t&aacute;me V&aacute;s na www str&aacute;nk&aacute;ch na&scaron;&iacute; firmy, kter&aacute; nab&iacute;z&iacute; kompletn&iacute; servis v oblasti stavebnictv&iacute; a souvisej&iacute;c&iacute;ch služeb.</p>\n<p style="font-family: ''Times New Roman''; font-size: medium;">V na&scaron;em portfoliu najdete &scaron;irokou nab&iacute;dku stavebn&iacute;ch prac&iacute; a rekonstrukc&iacute; rodinn&yacute;ch domů, bytů a interi&eacute;rů na kl&iacute;č. Poskytujeme tak&eacute; poradenstv&iacute; v oblasti realit. Na&scaron;e stavebn&iacute; firma pro V&aacute;s zajist&iacute; kompletn&iacute; realizaci stavby od prvn&iacute;ch n&aacute;vrhů a potřebn&yacute;ch &uacute;ředn&iacute;ch formalit, přes hrubou stavbu až po dokončovac&iacute; pr&aacute;ce.</p>\n<p style="font-family: ''Times New Roman''; font-size: medium;"><strong>Nab&iacute;z&iacute;me:</strong></p>\n<ul style="font-family: ''Times New Roman''; font-size: medium;">\n<li>Stavebn&iacute; činnost</li>\n<li>V&yacute;stavba rodinn&yacute;ch domů</li>\n<li>Rekonstrukce bytů</li>\n<li>Ploty</li>\n<li>Gar&aacute;že</li>\n<li>Krby</li>\n<li>Zahrady</li>\n<li>Jez&iacute;rka</li>\n<li>Pergoly</li>\n<li>Zahradn&iacute; krby</li>\n<li>Zahradn&iacute; architektura</li>\n<li>Kamenn&eacute; pr&aacute;ce</li>\n<li>B&aacute;zeny a v&yacute;hřivn&eacute; vany</li>\n</ul>'),
(39, 21, 'cs', '<p class="MsoNormal" style="text-align: justify;">&nbsp;</p>\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 12.0pt; line-height: 107%; font-family: ''Verdana'',sans-serif;">V&yacute;stavba rodinn&yacute;ch domů</span></strong></p>\n<p style="margin: 0cm 0cm 12pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-family: Verdana, sans-serif;">Nab&iacute;z&iacute;me V&aacute;m kompletn&iacute; stavbu rodinn&yacute;ch domů na kl&iacute;č za velmi v&yacute;hodn&yacute;ch cenov&yacute;ch podm&iacute;nek. Zaji&scaron;ťujeme kompletn&iacute; ře&scaron;en&iacute; stavby od vypracov&aacute;n&iacute; projektov&eacute; dokumentace a zaji&scaron;těn&iacute; financ&iacute; až po kolaudaci. Můžete v&scaron;ak využ&iacute;t jen č&aacute;sti těchto služeb.</span></p>\n<p style="margin: 0cm 0cm 12pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-family: Verdana, sans-serif;">Rodinn&eacute; domy jsou v z&aacute;kladn&iacute;m proveden&iacute; realizov&aacute;ny ze standardn&iacute;ch materi&aacute;lů a standardn&iacute;mi stavebn&iacute;mi technologiemi. Materi&aacute;lov&eacute; proveden&iacute; stavby lze samozřejmě na př&aacute;n&iacute; n&aacute;ročněj&scaron;&iacute;ch z&aacute;kazn&iacute;ků libovolně modifikovat a upravit.</span></p>\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 12.0pt; line-height: 107%; font-family: ''Verdana'',sans-serif;">Rekonstrukce bytů</span></strong></p>\n<p style="margin: 0cm 0cm 12pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-family: Verdana, sans-serif;">Kompletn&iacute; rekonstrukce bytů bytov&yacute;ch jader panelov&eacute;ho bytu, koupelny, kuchyně a interi&eacute;rů.<br /> Jsme specialist&eacute; na kompletn&iacute; rekonstrukce bytu a interi&eacute;ru</span></p>\n<p style="margin: 0cm 0cm 12pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-family: Verdana, sans-serif;">Nab&iacute;z&iacute;me služby bytov&eacute;ho architekta a poradenstv&iacute; v dispozičn&iacute;m uspoř&aacute;d&aacute;n&iacute; bytů.</span></p>\n<p style="margin: 0cm 0cm 12pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-family: Verdana, sans-serif;">V dne&scaron;n&iacute; době již st&aacute;vaj&iacute;c&iacute; j&aacute;dra v panelov&yacute;ch domech zpravidla nesplňuj&iacute; n&aacute;roky na ně kladen&eacute;, ať pro svůj věk, nov&eacute; trendy, či standardy. Na druhou stranu si plně uvědomujeme finančn&iacute; a časov&eacute; n&aacute;roky spojen&eacute; s přestavbou.<br /> Jsme připraveni V&aacute;m poskytnout velmi atraktivn&iacute; nab&iacute;dky na&scaron;ich prac&iacute;.</span>&nbsp;</p>'),
(40, 22, 'cs', '<p>&nbsp;</p>\n<p class="MsoNormal"><strong><span style="font-size: 12pt; line-height: 107%; font-family: Verdana, sans-serif;">Ploty</span></strong></p>\n<p class="MsoNormal" style="margin-bottom: 12pt; text-align: justify; line-height: 12.45pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">V na&scaron;em sortimentu zbož&iacute; naleznete ve&scaron;ker&eacute; z&aacute;kladn&iacute; druhy plotů jako uzlov&aacute;, oborn&iacute;, klasick&aacute;, prohazovac&iacute; a dekoračn&iacute;. D&aacute;le dod&aacute;v&aacute;me kompletn&iacute; prvky na stavbu a mont&aacute;ž oplocen&iacute; jako jsou sloupky spolu se zahradn&iacute;mi brankami a br&aacute;nami, vzpěry, v&aacute;zac&iacute; a nap&iacute;nac&iacute; dr&aacute;ty, nap&iacute;nac&iacute; strojky, ostnat&yacute; dr&aacute;t.</span></p>\n<p class="MsoNormal" style="margin-bottom: 12pt; text-align: justify; line-height: 12.45pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">Plotov&eacute; syst&eacute;my produkovan&eacute; na&scaron;&iacute; společnost&iacute; jsou ide&aacute;ln&iacute;m ře&scaron;en&iacute;m k ohraničen&iacute; soukrom&yacute;ch pozemků, provozoven, hal, různ&yacute;ch průmyslov&yacute;ch ploch, zahrad a sadů, staveni&scaron;ť a mnoh&yacute;ch dal&scaron;&iacute;ch objektů.<br /> Vyberte si z na&scaron;&iacute; nab&iacute;dky v&scaron;e, co potřebujete</span></p>\n<p class="MsoNormal" style="margin-bottom: 12pt; text-align: justify; line-height: 12.45pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">M&aacute;te z&aacute;jem o plotov&yacute; syst&eacute;m k oplocen&iacute; va&scaron;eho pozemku? N&aacute;&scaron; v&yacute;robn&iacute; program nab&iacute;z&iacute; &scaron;irok&yacute; v&yacute;běr plotů a pletiv, kter&eacute; se využ&iacute;vaj&iacute; jako:</span></p>\n<p class="MsoNormal" style="margin-bottom: 12pt; text-align: justify; line-height: 12.45pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-family: Verdana, sans-serif; font-size: 16px;">-</span><span style="font-family: Verdana, sans-serif; font-size: 16px;">&nbsp;</span><span style="font-family: Verdana, sans-serif; font-size: 12pt;">oplocen&iacute; zahrad<br /></span><span style="font-size: 12pt; font-family: Verdana, sans-serif;">- průmyslov&eacute; oplocen&iacute;<br /> - bezpečnostn&iacute; oplocen&iacute;<br /> - oplocen&iacute; sportovi&scaron;ť<br /> - chovatelsk&aacute; pletiva</span></p>\n<p class="MsoNormal"><span style="font-size: 12.0pt; line-height: 107%; font-family: ''Verdana'',sans-serif;">&nbsp;</span></p>\n<p class="MsoNormal"><strong><span style="font-size: 12.0pt; line-height: 107%; font-family: ''Verdana'',sans-serif;">Gar&aacute;že</span></strong></p>\n<p class="MsoNormal"><span style="font-size: 12.0pt; line-height: 107%; font-family: ''Verdana'',sans-serif;">Stali jsme se jedinou společnost&iacute; v ČR zaji&scaron;ťuj&iacute; komplexn&iacute; ře&scaron;en&iacute; v oblasti dod&aacute;vky gar&aacute;žov&yacute;ch ře&scaron;en&iacute;.</span></p>\n<p class="MsoNormal"><span style="font-size: 12.0pt; line-height: 107%; font-family: ''Verdana'',sans-serif;">Dod&aacute;v&aacute;me, montujeme a pokl&aacute;d&aacute;me gar&aacute;že z betonu a oceli na kl&iacute;č. Gar&aacute;že řadov&eacute;, montovan&eacute;, prefabrikovan&eacute;, plechov&eacute; atd. Jedn&aacute; se o německou v&yacute;robu! Na&scaron;e motto nejsme tak bohat&iacute;, abychom kupovali Č&iacute;nsk&eacute; a Polsk&eacute; gar&aacute;že. Star&aacute;me se o kompletn&iacute; z&aacute;ručn&iacute; i poz&aacute;ručn&iacute; servis.</span></p>\n<p class="MsoNormal"><span style="font-size: 12.0pt; line-height: 107%; font-family: ''Verdana'',sans-serif;">Vyr&aacute;b&iacute;me gar&aacute;že na kl&iacute;č z plechu, dle n&aacute;vrhu a požadavku zhotov&iacute;me gar&aacute;že, dovezeme na m&iacute;sto a zabudujeme. Dle potřeb z&aacute;kazn&iacute; jsme schopni zhotovit nejen jednu gar&aacute;ž, ale dodat i v&iacute;ce gar&aacute;ž&iacute;. Dod&aacute;v&aacute;me gar&aacute;že na kl&iacute;č, jednokř&iacute;dl&aacute;, dvoukř&iacute;dl&aacute; gar&aacute;žov&aacute; vrata s pohonem i bez pohonu vrat.</span></p>\n<p class="MsoNormal"><span style="font-size: 12.0pt; line-height: 107%; font-family: ''Verdana'',sans-serif;">&nbsp;</span></p>\n<p class="MsoNormal" style="margin-bottom: 12pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><strong><span style="font-size: 12pt; font-family: Verdana, sans-serif;">Krby, krbov&aacute; kamna a krbov&eacute; vložky</span></strong></p>\n<p class="MsoNormal" style="margin-bottom: 12pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">- Krbov&aacute; kamna s&nbsp;v&yacute;měn&iacute;kem<br /> - Kachlov&aacute; kamna<br /> - Litinov&aacute; krbov&aacute; kamna<br /> - Ocelov&aacute; krbov&aacute; kamna<br /> - Kamna na uhl&iacute;<br /> - Spor&aacute;k na tuh&aacute; paliva<br /> - Krbov&eacute; vložky s&nbsp;v&yacute;měn&iacute;kem<br /> - Teplovzdu&scaron;n&eacute; krbov&eacute; vložky<br /></span></p>\n<p class="MsoNormal" style="margin-bottom: 12pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">Stavebn&iacute; materi&aacute;ly:</span></p>\n<p><span style="font-size: 12pt; line-height: 107%; font-family: Verdana, sans-serif;">- </span><span style="font-size: 12pt; line-height: 107%; font-family: Verdana, sans-serif;">Ž&aacute;ruvzdorn&eacute; malty, lepidla<br /> - Kamn&aacute;řsk&eacute; om&iacute;tky<br /> - Kamn&aacute;řsk&aacute; perlinka<br /> - Stavebně izolačn&iacute; desky<br /> - Desky do topeni&scaron;tě<br /> - &Scaron;amotov&eacute; cihly<br /> - &Scaron;amotov&eacute; desky<br /></span><span style="font-size: 12pt; font-family: Verdana, sans-serif;"><span style="font-size: 12pt;">- Akumulačn&iacute; tvarovky</span>&nbsp;</span></p>\n<p class="MsoListParagraphCxSpFirst" style="margin-bottom: 12pt; text-align: justify; text-indent: -18pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><!-- [if !supportLists]--><span style="font-size: 12pt; font-family: Symbol;"><span style="font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp; &nbsp; &nbsp; </span></span><strong><span style="font-size: 12pt; line-height: 107%; font-family: Verdana, sans-serif;">&nbsp;</span></strong></p>\n<p class="MsoNormal"><strong><span style="font-size: 12pt; line-height: 107%; font-family: Verdana, sans-serif;">B&aacute;zeny a v&yacute;hřivn&eacute; vany</span></strong></p>\n<p style="margin: 0cm 0cm 12pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-family: Verdana, sans-serif;">Pro na&scaron;e z&aacute;kazn&iacute;ky nab&iacute;z&iacute;me &scaron;irok&yacute; sortiment baz&eacute;nů, př&iacute;slu&scaron;enstv&iacute;, ale i služeb spojen&yacute;ch s jejich &uacute;držbou. Samozřejmost&iacute; je stavba baz&eacute;nu na kl&iacute;č, kdy jsme schopni dodat a postavit baz&eacute;n dle přesn&yacute;ch požadavků z&aacute;kazn&iacute;ka.</span></p>'),
(41, 23, 'cs', '<p style="margin: 0cm 0cm 12pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">&nbsp;</p>\n<p style="margin: 0cm 0cm 12pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><strong style="text-align: start;"><span style="font-size: 12.0pt; line-height: 107%; font-family: ''Verdana'',sans-serif;">Jez&iacute;rka</span></strong></p>\n<p style="margin: 0cm 0cm 12pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-family: Verdana, sans-serif;">Prov&aacute;d&iacute;me stavbu, rekonstrukci a &uacute;držbu zahradn&iacute;ch jez&iacute;rek / biotopů. Nab&iacute;z&iacute;me kvalitn&iacute; a rychl&eacute; služby, cenově dostupn&eacute; zahradn&iacute; jez&iacute;rka pro každ&eacute;ho a seri&oacute;zn&iacute; jedn&aacute;n&iacute; s klienty. Nev&aacute;hejte n&aacute;s kontaktovat a uvid&iacute;te, že biotopy jsou to prav&eacute; pro V&aacute;s a Va&scaron;i rodinu!</span></p>\n<p style="margin: 0cm 0cm 12pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-family: Verdana, sans-serif;">Jez&iacute;rka zahradn&iacute; jez&iacute;rka můžete vybudovat i čistě na př&iacute;rodn&iacute; a ekologick&eacute; b&aacute;zi. Hliněn&yacute; podklad můžete izolovat pl&aacute;ty či cihlami z mazlav&eacute;ho j&iacute;lu. J&iacute;l postupně vodu přij&iacute;m&aacute;, pak n&aacute;sledně zbytn&iacute; a dal&scaron;&iacute; vodu nepropust&iacute;. Dal&scaron;&iacute; v&yacute;hodou j&iacute;lu je, že pohlcuje v&scaron;echny nadbytečn&eacute; živiny z jez&iacute;rka a zpětně je pak dok&aacute;že rostlin&aacute;m uvolnit. I když je j&iacute;l nejpřirozeněj&scaron;&iacute; izolačn&iacute; materi&aacute;l pro jez&iacute;rko, v praxi se př&iacute;li&scaron; často nepouž&iacute;v&aacute;.</span></p>\n<p class="MsoNormal"><strong><span style="font-size: 12.0pt; line-height: 107%; font-family: ''Verdana'',sans-serif;">Pergoly</span></strong></p>\n<p style="margin: 0cm 0cm 12pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-family: Verdana, sans-serif;">R&aacute;di V&aacute;s provedeme na&scaron;i v&yacute;robou alt&aacute;nů, pergol, gar&aacute;žov&yacute;ch př&iacute;stře&scaron;ků, zastře&scaron;en&yacute;ch teras, a dal&scaron;&iacute;ch staveb do zahrady jako jsou dřevoplastov&eacute; terasov&eacute; podlahy.</span></p>\n<p style="margin: 0cm 0cm 12pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-family: Verdana, sans-serif;">Zahradn&iacute; dřevostavby jsou vyr&aacute;běny ze smrkov&eacute;ho př&iacute;rodně su&scaron;en&eacute;ho řeziva. Řezivo je tř&iacute;děno dle požadavků technick&yacute;ch norem z hlediska pevnosti a &uacute;nosnosti. Jednotliv&eacute; komponenty dřevostaveb jsou hoblovan&eacute;.</span></p>\n<p class="MsoNormal"><strong><span style="font-size: 12.0pt; line-height: 107%; font-family: ''Verdana'',sans-serif;">Zahradn&iacute; krby</span></strong></p>\n<p class="MsoNormal"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">- Rychl&eacute; a snadn&eacute; grilov&aacute;n&iacute;<br />- J</span><span style="font-size: 12pt; font-family: Verdana, sans-serif;">ednoduch&eacute; a funkčn&iacute; ře&scaron;en&iacute;<br />-&nbsp;</span><span style="font-size: 12pt; font-family: Verdana, sans-serif;">&Scaron;irok&yacute; v&yacute;běr variant a tvarů<br />-&nbsp;</span><span style="font-size: 12pt; font-family: Verdana, sans-serif;">Možnost kombinace typů</span></p>\n<p class="MsoNormal"><strong><span style="font-size: 12pt; font-family: Verdana, sans-serif;">V&yacute;hody na&scaron;ich zahradn&iacute;ch krbů</span></strong></p>\n<p class="MsoNormal"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">- prostor ohni&scaron;tě obložen &scaron;amotov&yacute;mi pl&aacute;tky (v&yacute;razn&eacute; prodloužen&iacute; životnosti)<br />-&nbsp;</span><span style="font-size: 12pt; font-family: Verdana, sans-serif;">spodn&iacute; př&iacute;vod vzduchu do topeni&scaron;tě (snadn&eacute; podp&aacute;len&iacute; a dokonal&eacute; hořen&iacute;)<br />-&nbsp;</span><span style="font-size: 12pt; font-family: Verdana, sans-serif;">vyj&iacute;mateln&yacute; nerezov&yacute; popeln&iacute;k (snadn&eacute; čistěn&iacute; a &uacute;držba)<br />-&nbsp;</span><span style="font-size: 12pt; font-family: Verdana, sans-serif;">ochrann&yacute; nerezov&yacute; plech na předn&iacute; straně ohni&scaron;tě (zv&yacute;&scaron;en&aacute; bezpečnost a vždy čist&aacute; plocha před ohni&scaron;těm)</span></p>'),
(42, 24, 'cs', '<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">&nbsp;</p>\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><strong><span style="font-size: 12pt; font-family: Verdana, sans-serif;">Zahradnick&aacute; architektura</span></strong><span style="font-size: 12pt; font-family: Verdana, sans-serif;">&nbsp;</span></p>\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">&nbsp;</p>\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">- Zaj&iacute;mav&aacute; ře&scaron;en&iacute; městsk&yacute;ch, př&iacute;městsk&yacute;ch a venkovsk&yacute;ch zahrad</span></p>\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">- Rekonstrukce star&yacute;ch zahrad</span></p>\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">- Veřejn&aacute; zeleň, firemn&iacute; objekty</span></p>\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">- Přeměna zd&aacute;nlivě nudn&eacute;ho pozemku pomoc&iacute; modelace ter&eacute;nu v &uacute;tuln&eacute; m&iacute;sto odpočinku</span></p>\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">- Př&iacute;rodn&iacute; materi&aacute;ly &ndash; k&aacute;men, &scaron;těrky, dřevo, keramika, kov</span></p>\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">- Vodn&iacute; prvky &ndash; jez&iacute;rko, potok</span></p>\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">- Prvky zahradn&iacute; architektury &ndash; terasy, cesty, &scaron;lap&aacute;ky, z&iacute;dky, schody, plastiky, n&aacute;doby</span></p>\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">- Zahradn&iacute; stavby &ndash; pergoly, trel&aacute;že</span></p>\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">- Zahradn&iacute; osvětlen&iacute;</span></p>\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">&nbsp;</span></p>\n<p class="MsoNormal" style="margin-bottom: 12pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><strong><span style="font-size: 12pt; font-family: Verdana, sans-serif;">Kamenictv&iacute; a kamenick&eacute; pr&aacute;ce</span></strong></p>\n<p class="MsoNormal" style="margin-bottom: 12pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">Na zak&aacute;zku vyr&aacute;b&iacute;me a zaji&scaron;ťujeme:</span></p>\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">- kuchyňsk&eacute; pracovn&iacute; desky, koupelnov&eacute; desky</span></p>\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">- obklady krbů</span></p>\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">- okenn&iacute; parapety</span></p>\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">- kamenn&eacute; obklady a dlažby</span></p>\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">&nbsp;</span></p>\n<p class="MsoNormal" style="margin-bottom: 12pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><strong><span style="font-size: 12pt; font-family: Verdana, sans-serif;">Stavebn&iacute; a interi&eacute;rov&eacute; prvky</span></strong></p>\n<p class="MsoNormal" style="margin-bottom: 12pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">Stavebn&iacute; a interi&eacute;rov&eacute; prvky vyr&aacute;b&iacute;me zpravidla na zak&aacute;zku. Na&scaron;e technologie n&aacute;m umožňuje vyr&aacute;bět v&yacute;robky do průměru 70 cm a d&eacute;lky 2 m (vnitřn&iacute; otvory sloupů do d&eacute;lky 1,8 m).</span></p>\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">- kamenn&eacute; sloupy</span></p>\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">- kuželky a balustr&aacute;dy</span></p>\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">- font&aacute;ny</span></p>\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">- kamenn&eacute; koule</span></p>\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">- kamenn&aacute; umyvadla</span></p>\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">&nbsp;</span></p>\n<p class="MsoNormal" style="margin-bottom: 12pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><strong><span style="font-size: 12pt; font-family: Verdana, sans-serif;">Speci&aacute;ln&iacute; kamenick&aacute; v&yacute;roba pro průmysl</span></strong></p>\n<p class="MsoNormal" style="margin-bottom: 12pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 12pt; font-family: Verdana, sans-serif;">Atypickou v&yacute;robou jsou kamenn&aacute; mlec&iacute; a drt&iacute;c&iacute; kola nebo v&aacute;lce pro pap&iacute;rensk&yacute; a potravin&aacute;řsk&yacute; průmysl. Um&iacute;me s vysokou přesnost&iacute; spojit kovov&yacute; hř&iacute;del s kamenn&yacute;m n&aacute;bojem.</span></p>'),
